import Navbar from "../components/Navbar";
import Style from "../components/Style";

const Index = () => (
  <div id="blueBox">
    <Navbar />
    <div id="header"></div>
    <div className="contentTitle">Welcome to BlueBliss Inc.</div>
    <div className="pageContent">
      <p>This is a simple site, without much content.</p>
      <p>
        Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Integer mi.
        Vivamus sit amet neque vitae sapien bibendum sodales. Curabitur
        elementum. Duis imperdiet. Donec eleifend porttitor sapien. Praesent
        leo. Quisque auctor velit sed tellus. Suspendisse potenti. Aenean
        laoreet imperdiet nunc. Donec commodo suscipit dolor. Aenean nibh. Sed
        id odio. Aliquam lobortis risus ut felis. Sed vehicula pellentesque
        quam.
      </p>
      <p>
        Vestibulum augue quam, interdum id, congue semper, convallis non, velit.
        Quisque augue tortor, tristique ac, scelerisque eget, aliquam id, sem.
        Aenean lorem. Fusce velit nibh, dapibus quis, laoreet nec, porta a, dui.
        Nullam ac urna. Proin eget elit. Nunc scelerisque venenatis urna. Lorem
        ipsum dolor sit amet, consectetuer adipiscing elit. Class aptent taciti
        sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.
        Fusce congue, turpis ut commodo mattis, pede erat fringilla tellus,
        pulvinar suscipit odio lorem sed pede.
      </p>
    </div>
    <style jsx>{`
      html {
        overflow: hidden;
        height: 99%;
      }

      body {
        background: $ffffff;
        height: 99%;
        margin: 0;
        padding: 0;
        line-height: 150%;
        text-align: center;
      }

      * {
        font-size: 8pt;
        font-family: Tahoma, Verdana, sans-serif;
        color: #000000;
        text-align: left;
      }

      /* === Containers === */

      #mainContentArea {
        margin: 0 auto 0 auto;
        display: table;
        height: 100%;
        position: relative;
        overflow: hidden;
        width: 600px;
      }

      .link,
      .linkActive {
        width: 75px;
        margin-right: 10px;
        float: left;
        margin-top: 24px;
        text-align: center;
        font-family: Georgia, "Times New Roman", Times, serif;
        background-image: url(tab.gif);
        position: relative;
        bottom: 0px;
      }

      .link:hover {
        background-image: url(tab2.gif);
      }

      a {
        text-decoration: none;
      }

      .link a {
        font-family: Arial, Helvetica, sans-serif;
        font-size: 12px;
        font-weight: bold;
      }

      #linkGroup {
        margin-right: 10px;
        height: 40px;
        width: 600px;
      }

      #title {
        width: 230px;
        height: 40px;
        margin-right: 20px;
        margin-top: 15px;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        font-size: 20px;
        font-weight: bold;
        text-align: center;
        float: left;
      }

      .contentTitle {
        font-family: Verdana, Arial, Helvetica, sans-serif;
        color: #213e74;
        font-size: 19px;
        margin-left: 15px;
        margin-right: 12px;
        margin-bottom: 12px;
        width: 573px;
      }

      .pageContent {
        font-family: Arial, Helvetica, sans-serif;
        color: #000000;
        font-size: 12px;
        margin-left: 20px;
        margin-right: 20px;
        width: 560px;
      }

      #blueBox {
        position: absolute;
        vertical-align: middle;
        background-color: #e7edf8;
        width: 600px;
        clear: both;
      }

      #header {
        width: 600px;
        height: 20px;
        background-color: #ffffff;
        background-image: url(header.gif);
        background-repeat: no-repeat;
      }

      #footer {
        width: 600px;
        height: 20px;
        background-color: #ffffff;
        background-image: url(footer.gif);
        background-repeat: no-repeat;
        text-align: center;
        padding-right: 10px;
        color: #bdcdec;
      }
      #footer a {
        font-size: 9px;
        color: #bdcdec;
      }

      #contentBox {
        margin-top: 25px;
      }

      html,
      body {
        text-align: center;
      }
      p {
        text-align: left;
      }
    `}</style>
  </div>
);

export default Index;
